USE [B9DA102_DATA_SOURCE]

create table Instructor_T (
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	instructor_id VARCHAR (10) not null,
	department_id INT,
	qualification VARCHAR(7),
	year_of_employment VARCHAR (10),
	total_years_of_employment DECIMAL(10,2),
	CONSTRAINT instructor_PK PRIMARY KEY (instructor_id),
	CONSTRAINT department_FK FOREIGN KEY (department_id) REFERENCES Department_T (department_id)
);

